measurements.description:
Two flowers on two up to 30-cm inflorescences;
dorsal sepal slightly undulate, obovate, ciliate, hirsute on adaxial surface, chartreuse, overlaid maroon proximally;
 synsepal obovate, slightly undulate, ciliate, hirsute on adaxial surface, veined maroon centrally;
 petals ciliate, spatulate, undulate, reflexed distally, chartreuse, spotted maroon proximally, 
 overlaid bright lavender distally, margin dark lavender; 
 pouch chartreuse, lightly overlaid light maroon, stippled maroon upper half; 
 staminode chartreuse, overlaid maroon proximally, umbo chartreuse; 
 substance medium; texture glossy.
